.date-selection-container {
  width: 100%;
}

.date-selection-container h2 {
  margin-bottom: 1.5rem;
  font-size: 1.5rem;
  color: #2c2f11;
}

/* Override react-calendar styles */
.react-calendar {
  width: 100%;
  max-width: 100%;
  margin: 0 auto;
  border: none;
  font-family: inherit;
  background: transparent;
}

.react-calendar__navigation {
  margin-bottom: 20px;
}

.react-calendar__navigation button {
  min-width: 44px;
  background: none;
  font-size: 1.4rem;
  padding: 8px;
  color: #2c2f11;
  border-radius: 8px;
  transition: all 0.3s ease;
}

.react-calendar__navigation button:enabled:hover,
.react-calendar__navigation button:enabled:focus {
  background-color: rgba(44, 47, 17, 0.1);
}

.react-calendar__navigation button[disabled] {
  opacity: 0.5;
  background: none;
}

.react-calendar__month-view__weekdays {
  text-align: center;
  text-transform: uppercase;
  font-weight: bold;
  font-size: 0.9em;
  color: #2c2f11;
  margin-bottom: 8px;
  abbr {
    text-decoration: none;
    border: none;
  }
}

.react-calendar__month-view__days__day--weekend {
  color: #d10000;
}

.react-calendar__tile {
  padding: 1.2em 0.5em;
  background: none;
  text-align: center;
  line-height: 16px;
  font-size: 0.9em;
  color: #2c2f11;
  border-radius: 8px;
  transition: all 0.3s ease;
}

.react-calendar__tile:enabled:hover,
.react-calendar__tile:enabled:focus {
  background-color: rgba(44, 47, 17, 0.1);
}

.react-calendar__tile--now {
  background: rgba(44, 47, 17, 0.05);
  font-weight: bold;
}

.react-calendar__tile--now:enabled:hover,
.react-calendar__tile--now:enabled:focus {
  background: rgba(44, 47, 17, 0.15);
}

.react-calendar__tile--active {
  background: #2c2f11 !important;
  color: yellowgreen !important;
  font-weight: bold;
}

.react-calendar__tile--active:enabled:hover,
.react-calendar__tile--active:enabled:focus {
  background: #2c2f11;
}

.react-calendar__tile--disabled {
  background: none;
  color: #ccc;
}

.react-calendar__month-view__days__day--neighboringMonth {
  color: #969696;
}

/* Custom styles for better visibility */
.react-calendar__tile--hasActive {
  background: #2c2f11;
}

.react-calendar__tile--range {
  background: rgba(44, 47, 17, 0.1);
  color: #2c2f11;
}

/* Responsive adjustments */
@media (max-width: 768px) {
  .react-calendar {
    max-width: 100%;
  }

  .react-calendar__tile {
    padding: 0.8em 0.3em;
    font-size: 0.85em;
  }
}

